// src/components/Footer.jsx
import React from 'react';
import '../index.css'
import { Instagram, Mail, Linkedin, Phone } from 'lucide-react';

const Footer = () => {
  return (
    <section
  id="footer"
  className="relative flex flex-wrap bg-cover bg-center bg-no-repeat outline outline-2 outline-blue"
>
  {/* Layer background dengan blur */}
  <div
    className="absolute inset-0 bg-cover bg-center bg-no-repeat backdrop-blur-md"
    style={{ backgroundImage: `url("/assets/images/footertexture.jpg")`, zIndex: '-1' }}
  ></div>

  {/* Isi konten footer */}
  <div className="relative z-10">
    <p className="font-instrument text-white font-semibold text-lg">Contact</p>
    <div className="flex gap-4 items-center">
      <Instagram className="text-gold w-12 h-12" />
      <Mail className="text-gold w-12 h-12" />
      <Linkedin className="text-gold w-12 h-12" />
      <Phone className="text-gold w-12 h-12" />
    </div>
  </div>

  <div className="relative z-10">
    <img src="/assets/images/bgLogo.jpg" alt="BG Logo" className="w-64 h-40" />
    <img src="/assets/images/logoVM.jpg" alt="Logo VM" className="w-64 h-40" />
  </div>

  <div className="relative z-10">
    <p>About / Education / Experience / Contact</p>
    <p>2025 COPYRIGHT  |  MUHAMMAD VIKHAN MUHARRAM  |  ALL RIGHTS RESERVED </p>
  </div>
</section>
  );
};

export default Footer;
